import axios from '../config/axios';
const qs = require('qs');

export default {

  get: () => {
    return axios.get('activities');
  },

  delete: (activity_id) => {
    return axios.delete('activities', qs.stringify({ 'activity_id': activity_id }));
  },

  create: (activity) => {
    const { title, type, status, owner_id } = activity;
    var x = qs.stringify({ activity });
    console.log(x);
    console.log(title)
    console.log(type)
    console.log(status)
    return axios.post('activities', activity).then(response => {
      console.log(response)
    });
  }
}
